   "source": [
    "Each observation represents one combination of \"vote\" + \"country\" = \"roll call ID\"\n",
    "\n",
    "'session': year-long session in the UN's history the vote was cast\n",
    "\n",
    "'vote': vote code \n",
    "- 1: yes\n",
    "- 2: abstain\n",
    "- 3: No\n",
    "- 8: Not present\n",
    "- 9: not a member\n",
    "\n",
    "'ccode': country code\n",
    "\n",
    "#### 1. Data cleaning"
   ]
